DF_aggr = DF_aggr.reset_index().drop_duplicates(subset=['ENSG', 'count_type', 'plot_type', 'threshold', 'p_value', 'fst_life_mean', 'scnd_life_mean']).set_index(['ENSG', 'count_type', 'plot_type', 'threshold'])
